$(document).on("magistraal.ready",function(){magistraal.api.call("tenants/list").then(a=>{$.each(a.data,function(a,t){magistraal.element.get("tenants-list").append(`<li data-search="${t.name}" style="display: none;" value="${t.id}">${t.name}</li>`)})})}),$("li").on("click",function(){console.log($(this).text())});